	    if(this.formsList == undefined){
	        this.formsList = [];
	    }
	    const id = new Date().getTime();
	    let objToInsert;
	    switch (typ) {
        	case "text":
        	    objToInsert = {
                        "type": typ,
                        "config": {
                            "mandatory": false,
                            "placeholder": "Placeholder",
                            "label": "Label",
                            "label_color": "primary",
                            "position": 'unset',
                            "type": 'text',
                            "clearInput": false,
                        },
                        "id": id,
                        "name": "inputText"+id
                    };
        		break;

        	case "img":
        	    objToInsert = {
                            "type": typ,
                            "config": {
                                "src": "assets/images/category.png",
                                "alt": "NO IMAGE",
                                "width": "128",
                                "height": "128"
                            },
                            "id": id,
                            "name": "imageFile"+id
                        };
        	    break;

        	case "checkbox":
        	    objToInsert = {
                            "type": typ,
                            "config": {
                                "checked": false,
                                "disabled": false,
                                "color": "primary",
                                "label_color": "dark",
                                "label": "Label"
                            },
                            "id": id,
                            "name": "checkbox"+id
                        };
                break;

        	case "group":
        	    objToInsert =
                        {
                            "type": "ion-card",
                            "config": {

                            },
                            "children":[],
                            "id": id,
                            "name": "ion-card"+id
                        };
                break;

        	default:
        		break;
        }
	    if(index != null){
            if(index[1] != null){
                this.formsList[index[0]]["children"].splice(index[1], 0, objToInsert);
            }
            else{
                this.formsList.splice(index, 0, objToInsert);
            }
        }
        else{
            this.formsList.push(objToInsert);
        }
        // After having modifying Object, update its state with fs base
        this.updateState();

	}

	delElement(id){
	    this.formsList.splice(this.getElementIndexById(id), 1);
	    // After having modifying Object, update its state with fs base
	    this.updateState();
	}

	swapElement(from, to){
        this.formsList.splice(to, 0, this.formsList.splice(from, 1)[0])
        // After having modifying Object, update its state with fs base
        this.updateState();
