		vars.item.config.src = vars.src;
		this.formsSubmit[vars.item.name]= vars.src;
		resolve();

		let params = {
		        "docid": "C8ODATA__" + this["global"]["formSelected"]["_id"].replace('C8OSOURCE__', '')
		}
		this.c8o.callJsonObject("fs://c8oforms_fs.get", params)
		.then((resp:any, params: any)=>{

		    delete resp._rev;
		    resp[this.global.user] = this.formsSubmit;
		    resp["_use_policy"] = "override";
		    this.c8o.callJsonObject("fs://c8oforms_fs.post", resp)
	        .then((resp2:any, params2: any)=>{
	            this.c8o.log.debug("postresultats:" + JSON.stringify(resp2));
	            resolve();
	            return null;
	        })
	        .fail((err:any)=>{
	            this.c8o.log.error("postresultats:" + JSON.stringify(err));
	            resolve();
	        });
		    return null;
		})
		.fail((err:any)=>{
		    params["_id"]= params["docid"];
		    delete params["docid"];
		    params[this.global.user] = this.formsSubmit;
		    this.c8o.callJsonObject("fs://c8oforms_fs.post", params)
	        .then((resp:any, params: any)=>{
	            this.c8o.log.debug("postresultats:" + JSON.stringify(resp));
                resolve();
	            return null;
	        })
            .fail((err:any)=>{
